import React, {Component} from 'react';


export default class Navigation extends Component {
 render(){
   return(
     <Navbar>
       <Nav>
        <NavItem><a>Home</a></NavItem>
        <NavItem>Contact</NavItem>
        <NavItem>Templates</NavItem>
       </Nav>
     </Navbar>
  );}
}
